import { useState } from "react";

const InputImage = () => {
    const [selectedFile, setSelectedFile] = useState(null);

    const handleFileChange = (event) => {
        setSelectedFile(event.target.files[0]);
    };
    return (
        <>
            <input className="p-1 w-[785px] text-sm text-gray-900  rounded-sm cursor-pointer bg-[#F5F5F5] dark:text-gray-400  dark:bg-gray-700  dark:placeholder-[#DB4444]" type="file" multiple></input>
        </>
    );
};

export default InputImage;
